(19165, 'B6276783-C409-4B2D-9779-0364EB54BFDD', 'I miss you too. I didn’t feel so great about how we signed off last night. We can talk about it later. Big commute breakthrough! We biked to school and I picked up the FS bus into the city. It is a double decker! I’ll zoom with your mom tonight.', 'David', 'Nitzan', '2019-01-29T08:39:52.448818'),
