(19216, 'B3E541F0-B8B0-4048-85F6-91ECBE6E1755', 'Morning love. I’m here listening to 15 women parents who from low income communities tell their stories about eating from food pantries while completing their college degrees because their gov assistance programs deemed them ineligible. It’s a tearful room. Thinking about policy and advocacy implications.', 'Nitzan', 'David', '2019-01-30T09:04:40.686145'),
