(19224, 'ED7D2F62-15A9-4E2E-91BF-CFA6D1C602D2', 'Hey love! Miss you and can’t wait to hear more about your travels. Feels weird to hear these stories while battling with nathan to get him to go to school on time. Has been a tough morning. Orli had a rough time saying goodbye today and cried a lot. Was hard to leave her.', 'David', 'Nitzan', '2019-01-30T10:01:33.095736'),
