(19227, '03068943-9ABF-4FAE-88B5-8707808F9208', 'And what his suggestions are ', 'Nitzan', 'David', '2019-01-30T10:02:55.063849'),
(19228, 'D32C75D9-7DAB-4201-A07C-58A625C9E724', 'Here is what I wrote nathan: Nate...mentoring contacted me asking where you were....and why you’ve been late so often...and why you skipped school on MLK day...which was not optional. I’m really proud of all the progress you are making with Jonathan, with the shots, that you are dealing with hard stuff...like your braces... I’m really frustrated that you are not holding yourself accountable to school. This is your job...remember we discussed after Detroit how you need to really work on rebuilding trust at home. I need your focus here. It is really difficult for me to bust my ass to figure out how to support mentoring and amazing experiences like traveling to Italy when you are not holding up your end of the bargain. I want to sit down with you and John to work out a plan. ', 'David', 'Nitzan', '2019-01-30T10:03:41.837512'),
